import React from "react";
import ReactDOM from "react-dom";
import Table from "./Table3";

// const data = [
//   { param: "Admin", val: "0.03" },
//   { param: "Margin", val: "0.4" },
//   { param: "Price", val: "5080" }
// ];

const comonscol = [
  { title: "Country", field: "country" },
  { title: "Total Cases", field: "cases" },
  { title: "New Cases", field: "todayCases" },
];

//country.totalCases, country.deaths, country.todayDeaths, country.recovered, country.todayRecovered, country.active, country.critical

const TableContainer =  () => {

  const [data, setData] = React.useState([])

  React.useEffect(() => {
    fetch("https://disease.sh/v3/covid-19/countries")
      .then(res => res.json())
      .then(res => setData(res))
      .catch(err => console.log(err.message))
  }, [])
  console.log(data);

  return (
    <div className="App">
      <Table col={comonscol} data={data} />
    </div>
  );
}

export default TableContainer;
